import React from 'react';
import styled from 'styled-components';
import { Form } from '../components/Form';

export const Signup: React.FC = () => (
  <StyledSignup>
    <Form></Form>
  </StyledSignup>
);

const StyledSignup = styled.div`
  background-color: #0069a5;
  text-align: center;
  color: #eee;
  font-size: 35px;
  height: 100vh;
`;
